import React, { useState, useEffect } from 'react';
import { createPortal } from 'react-dom';
import { 
  ChartBarIcon,
  CalendarDaysIcon,
  ClockIcon,
  UserGroupIcon,
  MagnifyingGlassIcon,
  FunnelIcon,
  DocumentArrowDownIcon,
  EyeIcon,
  CheckCircleIcon,
  ExclamationTriangleIcon,
  XCircleIcon,
  AcademicCapIcon,
  MapPinIcon,
  BuildingOfficeIcon,
  BookOpenIcon,
  ChevronRightIcon,
  ChevronDownIcon,
  PresentationChartBarIcon,
  CalendarIcon,
  UsersIcon
} from '@heroicons/react/24/outline';
import toast from 'react-hot-toast';
import axios from 'axios';

// Set up axios defaults
axios.defaults.baseURL = 'http://localhost:5000';

function Reports() {
  const [reports, setReports] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filters, setFilters] = useState({
    startDate: '',
    endDate: '',
    subjectId: '',
    academicYear: '',
    semester: '',
    status: '',
    search: ''
  });
  const [subjects, setSubjects] = useState([]);
  const [academicYears, setAcademicYears] = useState([]);
  const [semesters, setSemesters] = useState([]);
  const [statistics, setStatistics] = useState(null);
  const [showFilters, setShowFilters] = useState(false);
  const [selectedReport, setSelectedReport] = useState(null);
  const [showDetailModal, setShowDetailModal] = useState(false);
  const [groupedReports, setGroupedReports] = useState({});
  const [groupBy, setGroupBy] = useState('subject'); // 'subject', 'date', 'session'
  const [expandedCards, setExpandedCards] = useState(new Set());
  const [viewMode, setViewMode] = useState('cards'); // 'cards', 'table'
  const [selectedGroup, setSelectedGroup] = useState(null);
  const [showGroupDetails, setShowGroupDetails] = useState(false);
  const [showClearDialog, setShowClearDialog] = useState(false);
  const [clearing, setClearing] = useState(false);

  useEffect(() => {
    fetchInitialData();
  }, []);

  useEffect(() => {
    fetchReports();
  }, [filters]);

  useEffect(() => {
    if (reports.length > 0) {
      groupReports(reports);
    }
  }, [groupBy, reports]);

  const fetchInitialData = async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        toast.error('Please login to access reports');
        return;
      }

      const headers = { Authorization: `Bearer ${token}` };

      // Fetch subjects, academic years, and semesters in parallel
      const [subjectsRes, academicYearsRes, semestersRes] = await Promise.all([
        axios.get('/api/subjects', { headers }),
        axios.get('/api/logs/attendance/stats', { headers }),
